def build_model(activation_function):
  model = Sequential()
  model.add(Dense(64, input_dim=10,activation=activation_function)) #hidden layer 1
  model.add(Dense(32, activation=activation_function)) #hidden layer 2
  model.add(Dense(1, activation='sigmoid')) #output layer
  model.compile(loss='binary_crossentropy', metrics=['accuracy'], optimizer='adam')

  return model

"""input_dim = 10 means that first hidden layer will receive 10 input features.

Output layer is having sigmoid activation function beacuse we want binary classigication and sigmoid is the function used for this purpose.

#Building ReLu Model
"""

ReLu_model = build_model('relu')
#successfully defined a model for the activation function = ReLu in the hidden layers
#Now its time to train the model

"""#Training ReLu Model"""

import time

