"""#Training VS Validation History"""

def plot_history(act_hist, title):
  plt.plot(act_hist.history['accuracy'])
  plt.plot(act_hist.history['val_accuracy'])
  plt.plot(act_hist.history['loss'])
  plt.plot(act_hist.history['val_loss'])

  plt.legend(['accuracy','val_accuracy','loss','val_loss'])

  plt.title(title)
  plt.xlabel('Epochs')
  plt.ylabel('Accuracy')
  plt.show()

