def plot_bar_acc(model_act, model_names,acc_name):
  accuracies = [model.history[acc_name][-1] for model in model_act]  #-1 for last epoch accuracy only
  plt.bar(model_names, accuracies,color=['blue','green','orange','red'] )
  plt.xlabel('Activation Function')
  plt.ylabel('Accuracy')
  plt.show()

