"""#ANN QUIZ MANUAL NEURAL NETWORK MODEL"""

inputs = np.array([0.2,0.8])

hidden_layer_weights = np.array([[0.5,-0.3],[0.2,0.8],[-0.4,0.6],[0.1,-0.5]])
hidden_layer_bias = np.array([0.1,-0.2,0.05,0.3])


output_layer_weights = np.array([0.3,-0.5,0.7,0.1])
output_layer_bias = -0.1

hidden_layer_input = np.dot(hidden_layer_weights, inputs) + hidden_layer_bias
hidden_layer_output = ReLu_activation(hidden_layer_input)

output_layer_input = np.dot(output_layer_weights,hidden_layer_output) + output_layer_bias
output_layer_output = sigmoid_activation(output_layer_input)


print(f'Hidden Layer Input : {hidden_layer_input}')
print(f'Hidden Layer Output ReLu Activation : {hidden_layer_output}')
print(f'Output Layer Input : {output_layer_input:.2f}')
print(f'Output Layer Output Sigmoid Activation : {output_layer_output:.2f}')

